Циклы в C# используются для выполнения повторяющихся действий. Есть несколько типов циклов:

1. `for` - используется для выполнения действия определенное количество раз.
   ```csharp
   for (int i = 0; i < 10; i++) {
       Console.WriteLine(i);
   }
   ```
   В этом примере цикл выполнится 10 раз, выводя значение переменной `i`.

2. `while` - выполняет действие до тех пор, пока условие истинно.
   ```csharp
   int i = 0;
   while (i < 10) {
       Console.WriteLine(i);
       i++;
   }
   ```
   Этот цикл будет продолжать выполнение, пока переменная `i` меньше 10.

3. `do...while` - аналогичен `while`, но проверяет условие после выполнения тела цикла.
   ```csharp
   int j = 0;
   do {
       Console.WriteLine(j);
       j++;
   } while (j < 10);
   ```
   Этот цикл гарантирует, что тело цикла будет выполнено хотя бы один раз.

